import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="intro-text">
        <p>When is CSN due?</p>
        <hr />
      </div>
      <div className="timer">
        <p>23 Days 13 Hours 34 Seconds</p>
      </div>
    </div>
  );
}

export default App;
